import { Box, Typography } from "@mui/material";

const Footer = () => {
  return (
    <Box display="flex" bgcolor="#252F3D" height="88px">
      <Box display="flex" alignItems="center" gap="16px">
        <Typography fontSize="16px" color="#FFFFFF">
          Copyright (c) 2023
        </Typography>
        <Box
          width="1px"
          height="10px"
          sx={{ backgroundColor: "#CFCFCF" }}
        ></Box>
        <Typography fontSize="16px" color="#FFFFFF">
          clarifionsupport@clarifion.com
        </Typography>
      </Box>
      <Box display="flex" alignItems="center" gap="16px">
        <img alt="lock" src="lock.png" style={{ color: '"#FFFFFF"' }} />
        <Typography fontSize="16px" color="#FFFFFF">
          Secure 256-bit SSL encryption.
        </Typography>
      </Box>
    </Box>
  );
};

export default Footer;
